    "raw_text": "Image ChallengeA 50-year-old man with a history of mitral-valve prolapse and of Hodgkin\u2019s lymphoma 20 years earlier presented to the emergency department with a 5-day history of dyspnea. Physical examination showed jugular venous distention, a holosystolic murmur at the cardiac apex, and diminished breath sounds in the lung bases. A radiograph of the chest was performed. What is the best next step in regard to the right lung opacity?\n\n1. Collect a sputum culture and then initiate empiric antibiotics\n2. Diurese the patient and then obtain a repeat chest radiograph\n3. Obtain a computed tomography scan of chest\n4. Perform a bronchoscopy\n5. Perform a thoracentesisQ:Answer:Image ChallengeA 50-year-old man with a history of mitral-valve prolapse and of Hodgkin\u2019s lymphoma 20 years earlier presented to the emergency department with a 5-day history of dyspnea. Physical examination showed jugular venous distention, a holosystolic murmur at the cardiac apex, and diminished breath sounds in the lung bases. A radiograph of the chest was performed. What is the best next step in regard to the right lung opacity?Q:Diurese the patient and then obtain a repeat chest radiograph\n\nThe correct answer is diurese the patient and then obtain a repeat chest radiograph. The chest radiograph showed signs of volume overload as well as a sharply demarcated, lenticular opacity in the right middle lung field. An echocardiogram showed an ejection fraction of 45% and severe mitral regurgitation. After 3 days of diuresis and vasodilator therapy, a follow-up chest radiograph showed complete resolution of the right lung opacity, as well as reduced pulmonary edema. A diagnosis of phantom tumor \u2014 also known as vanishing tumor or pseudotumor \u2014 was made. Phantom tumors are loculated interlobar pleural effusions that occur most commonly in the minor fissure, as in this case.\n\n",
