    "raw_text": "Image ChallengeA 64-year-old man with a history of bladder cancer treated with radical cystectomy and orthotopic neobladder construction with intestinal segments presented to the emergency department with left flank pain and urinary retention. CT of the abdomen and pelvis showed a very large stone in the neobladder. What is the predominant composition of this patient\u2019s stone?\n\n1. Struvite\n2. Uric acid\n3. Calcium oxalate\n4. Calcium phosphate\n5. CystineQ:Answer:Image ChallengeA 64-year-old man with a history of bladder cancer treated with radical cystectomy and orthotopic neobladder construction with intestinal segments presented to the emergency department with left flank pain and urinary retention. CT of the abdomen and pelvis showed a very large stone in the neobladder. What is the predominant composition of this patient\u2019s stone?Q:Calcium phosphate\n\nThe correct answer is calcium phosphate. This patient\u2019s stone composition was 80% calcium phosphate and 20% struvite. Risk factors for calcium phosphate crystal formation include high urine pH. The use of intestinal segments to create urinary diversions can lead to stone disease as a result of persistent bicarbonate loss in the urine, hyperoxaluria, and long-term colonization of urea-splitting bacteria in the urinary tract. Additional risks for stone formation in a continent urinary reservoir include urinary stasis, mucus production, and nonabsorbable surgical materials used to construct the substitute bladder.\n\n",
