    "raw_text": "Image ChallengeA 42-year-old man who was undergoing treatment for non-Hodgkin\u2019s lymphoma presented to the oncology clinic with changes in his fingernails. Five months earlier, he had presented with gastric-outlet obstruction and had received a diagnosis of high-grade B-cell non-Hodgkin\u2019s lymphoma. What is the most likely underlying cause of this presentation?\n\n1. Chemotherapy\n2. Paraneoplastic syndrome\n3. Metastatic disease of the nail bed\n4. Hepatic dysfunction\n5. Tetracycline Q:Answer:Image ChallengeA 42-year-old man who was undergoing treatment for non-Hodgkin\u2019s lymphoma presented to the oncology clinic with changes in his fingernails. Five months earlier, he had presented with gastric-outlet obstruction and had received a diagnosis of high-grade B-cell non-Hodgkin\u2019s lymphoma. What is the most likely underlying cause of this presentation?Q:Chemotherapy\n\nThe correct answer is chemotherapy. This patient completed four cycles of chemotherapy, which had included rituximab, etoposide, prednisone, vincristine, cyclophosphamide, and doxorubicin prior to this finding on physical examination. The opaque-appearing transverse lines (long arrow) on the fingernails are called Mees\u2019 lines (true leukonychia), and the more translucent-appearing lines (short arrow) are called Muehrcke\u2019s lines (apparent leukonychia). Mees\u2019 lines develop as a result of injury to the nail matrix, whereas Muehrcke\u2019s lines are related to abnormal nailbed vasculature. Therefore, Mees\u2019 lines do not diminish with compression of the nail plate, and Muehrcke\u2019s lines do. Multiple chemotherapy agents are associated with these nail changes. Muehrcke\u2019s lines can also occur in patients with hypoalbuminemia. After six cycles of chemotherapy, the patient had remission of the non-Hodgkin\u2019s lymphoma. Approximately 6 months after the completion of chemotherapy, the fingernail changes resolved completely.\n\n",
